import {Switch,Route} from "react-router-dom"
import './App.css';
import AppNavBar from './Components/Route/AppNavBar';

function App() {
  return (
    <div >
    <AppNavBar />
    <Switch>
      <Route exact path='/' render={()=><h2>Home</h2>} />
      <Route exact path='/' render={()=><h2>Dashboard</h2>} />

    </Switch>
    </div>
  );
}

export default App;
